CREATE DEFINER=`root`@`localhost` PROCEDURE `keyword_search`(IN keyword varchar(100),IN type_of_search varchar(100))
BEGIN
if (type_of_search = 'Track') then
Select t.Track_ID,Track_title,Track_duration,Track_aname,round(avg(Rating),1) as Rating,count(Play_time) as Played_Number
from track t left outer join rating r
on t.Track_ID = r.Track_id
left outer join play p
on t.Track_ID = p.Track_id
where Track_title REGEXP (REPLACE(keyword,' ','|')) OR Track_aname REGEXP (REPLACE(keyword,' ','|'))
group by t.Track_ID;    
ELSEIF (type_of_search = 'Album') then
Select Album_id, Album_title from Album where Album_Title REGEXP (REPLACE(keyword,' ','|'));
ELSE
Select Playlist_id,Playlist_title,Playlist_owner from playlist where Playlist_Title REGEXP (REPLACE(keyword,' ','|')) and public;
END IF;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
