CREATE DEFINER=`root`@`localhost` PROCEDURE `Last_Played_by_the_user`(`usernamepara` varchar(255))
BEGIN
   select t.Track_ID,Track_title,Track_duration,Track_aname,round(avg(Rating),1) as Rating,count(Play_time) as Played_Number  
   from track t left outer join rating r
on t.Track_ID = r.Track_id
   left outer join play p
on t.Track_ID = p.Track_id
   group by t.Track_ID
   having t.Track_ID in (Select distinct Track_id from play where Username = usernamepara)
   order by max(Play_time) desc
   limit 10;
END ;;
