CREATE DEFINER=`root`@`localhost` PROCEDURE `rating`(IN User varchar(100), IN Tra_id varchar(100), IN RATE INT)
BEGIN
DECLARE COUNT INT DEFAULT 0;
Select count(*) into COUNT from rating where Username = User and Track_id = Tra_id;
IF (count = 1) then
update rating
set rating = RATE
WHERE Username = User and Track_id = Tra_id;
ELSE 
INSERT INTO RATING (Username,Track_id,Rating,Rating_time)
values(User,Tra_id,RATE,SYSDATE());
END IF;     
END ;;
DELIMITER ;
