CREATE DEFINER=`root`@`localhost` PROCEDURE `Related_Artist`(IN User varchar(100))
BEGIN
Select distinct aname21
from
(Select aname
 from music_streaming_service.like
 where Username = User) as Interim_Result1,
(Select Result1.aname1 as aname11,Result1.aname2 as aname21
	from
	(Select l1.aname as aname1, l2.aname as aname2,count(l1.Username) as intersection
	from music_streaming_service.like as l1,music_streaming_service.like as l2
	where l1.aname < l2.aname and l1.Username = l2.Username group by l1.aname,l2.aname) as Result1,
  	(Select tab1.aname as aname1,tab2.aname as aname2,(a+b) as Total
	from
	(Select aname, count(Username) as a from music_streaming_service.like group by aname) as tab1,
	(Select aname, count(Username) as b from music_streaming_service.like group by aname) as tab2
	where tab1.aname < tab2.aname) as Result2
  	where Result1.aname1 = Result2.aname1 and Result1.aname2 = Result2.aname2
	and intersection/(Total-intersection) >= 0.5) as Interim_Result2
where Interim_Result1.aname = Interim_Result2.aname11 and aname21 not in (Select aname
																		  from music_streaming_service.like
                                                                          where Username = User);  
END ;;
DELIMITER ;
