CREATE DEFINER=`root`@`localhost` PROCEDURE `tracks_by_artist`(IN artist_name varchar(100))
BEGIN
select t.Track_ID,Track_title,Track_duration,round(avg(Rating),1) as Rating,count(Play_time) as Played_Number  
   from track t left outer join rating r
on t.Track_ID = r.Track_id
   left outer join play p
on t.Track_ID = p.Track_id
   where Track_aname = artist_name
   group by t.Track_ID;
END ;;
