CREATE DEFINER=`root`@`localhost` PROCEDURE `update_user`(IN User varchar(100),IN Name1 varchar(100), IN city varchar(100),IN email varchar(100), IN password1 varchar(100))
BEGIN
if (password1 = '') then
update user
set Email = email,City = city,Name = Name1
where Username = User;
else
update user
set Email = email,City = city,Name = Name1,Password = SHA2(password1,256) 
where Username = User;
end if;
END ;;
